Please solve the following problem and put your answer at the end with "The answer is: ".

In triangle $VWX$ shown, $VX = \sqrt{13}$ and $VW = X$. What is $\tan V$?

[asy]
pair V,W,X;
W = (0,0);
V = (0,3);
X = (2,0);
draw(V--W--X--V);
draw(rightanglemark(V,W,X,7));
label("$W$",W,SW);
label("$V$",V,NW);
label("$X$",X,SE);
