Please solve the following problem and put your answer at the end with "The answer is: ".

Find the number of solutions to the system of equations \[\begin{aligned} g(g(x)) &= \frac{19}{4}, \\ h(h(y)) &= y + \frac{15}{4}, \end{aligned}\] where \[g(x) = \left\{
\begin{array}{cl}
-x + 3 & \text{if } x \le 1, \\
2x - 5 & \text{if } x > 1.
\end{array}
\right.\] and \[h(y) = y - 2.\]

actual_full_response:
We can express $250$ as the product of $200$ and $1.25$, that is, $250 = 200 \cdot 1.25$. Applying the given equation twice, we have:

\begin{align*}
h(250) &= h(200 \cdot 1.25) \\
&= \frac{h(200)}{1.25} \\
&= \frac{2}{1.25} \\
&= \boxed{1.6}
\end{align*} The answer is: \frac{8}{5}

