draw((1,-6)--(5,-6),dashed+red); draw((5,-6)--(5,-2),dashed+blue);
draw((5,-2)--(9,-2),dashed+red); draw((9,-2)--(9,2),dashed+blue);
dot((9,2));
label("(?,?)",(9,2),E);
[/asy]

Observe the diagram. The endpoints of a diameter are equidistant and in the same line from the center of the circle. The movement from $(1,-6)$ to $(5,-2)$ involves $4$ right (left dashed red line) and $4$ up (left dashed blue line), hence from $(5,-2)$ to the other endpoint, we proceed $4$ right and $4$ up, resulting in coordinates $(5+4, -2+4)=\boxed{(9,2)}$. The answer is: (9,2)

