We have that
\[\sec (-300^\circ) + \tan (-300^\circ) = 2 + \frac{\sin (-300^\circ)}{\cos (-300^\circ)}.\]From the previous problem, we know $\sec (-300^\circ) = 2$. Now, since $\tan (-300^\circ) = -\tan (60^\circ) = -\sqrt{3}$,
\[2 + \frac{\sin (-300^\circ)}{\cos (-300^\circ)} = 2 - \sqrt{3} = \boxed{2 - \sqrt{3}}.\] The answer is: 2 - \sqrt{3}

The probability of the Grunters winning each game is $\frac{3}{4}$,
