actual_full_response:
There are 90000 five-digit positive integers. For those without a 6 or 7, the first digit could be one of the seven numbers 1, 2, 3, 4, 5, 8, or 9, and each of the other digits could be one of the eight numbers 0, 1, 2, 3, 4, 5, 8, or 9. So there are \[
90000- 7\cdot 8\cdot 8\cdot 8\cdot 8=\boxed{67200}
\] five-digit numbers  with at least one digit that is a 6 or a 7. The answer is: 67200

